//SPDX-License-Identifier:MIT
pragma solidity 0.8.7;

contract storageSlot{
    //hex value of a,b,c=32 bytes in slot 0 is,
    // 0x000000000000000000000000000000000000000000000000000000010d80220a
    uint8 public a=10;
    uint8 public b=34;
    uint16 public c=3456;
    uint256 public d=90;
    bool private check=true;
    bytes32[3] public data;
    uint256[] public arr=[5,4,3,2,1];
    
    constructor(bytes32[3] memory _data){
        data=_data;
    }
//keccak256(abi.encode(6))
    bytes32 constant public startingIndexOfValuesArrayElementsInStorage =keccak256(abi.encode(6))
;

    function getElementIndexInStorage(uint256 _elementIndex) public pure returns(bytes32) {
        return bytes32(uint256(startingIndexOfValuesArrayElementsInStorage) + _elementIndex);
    }
}

